sourcesContent:
export const accordionData = [
  {
    title: "Where can I purchase an NFT?",
    content: `You will be able to mint directly from our website in APR, 2022.`,
  },
  {
    title: "How many NFTs will be available?",
    content: `MOAR  is a collection consists of 5,555 NFTs.`,
  },
  {
    title: "How much will it cost?",
    content: `The mint price has not been disclosed yet. We will announce it on Discord at the same time as the announcement of the mint date.`,
  },
  {
    title: "How can I get access to the whitelist?",
    content: `Sapiente expedita hic obcaecati, laboriosam similique omnis architecto ducimus magnam accusantium corrupti
      quam sint dolore pariatur perspiciatis, necessitatibus rem vel dignissimos
      dolor ut sequi minus iste? Quas?`,
  },
  {
    title: "How the NFTs are created?",
    content: `They are drawn by our artist Joan Cornellà. The artwork will mint on the Ethereum blockchain.`,
  },
  {
    title: "Which wallets will I be able to use to mint an NFT?",
    content: `We offer a number of wallet connections for minting, but Metamask is the recommended wallet. Please check the instructions we have provided for how to mint with Metamask wallet.`,
  },
];
